svg.script:

    function ocultarSelect() {
        document.getElementById("Contato").style.display = "none";

        document.getElementById("selectExcluir").style.display = "none";
        document.getElementById("selectSobre").style.display = "none";
        document.getElementById("selectSobre_1_").style.display = "none";
        document.getElementById("selectProdutos").style.display = "none";
        document.getElementById("SelectVendedor").style.display = "none";

		if(document.getElementById("Botoes_1_").style.display !== "block"){
			document.getElementById("selectCadastrar").style.display = "none";
		}
    }

    function mostrarContato() {
	document.getElementById("Contato").style.display = "block";
    }

    function mostrarProdutos() {
	document.getElementById("selectProdutos").style.display = "block";
    }

    function mostrarSobre() {
	document.getElementById("selectSobre").style.display = "block";
        document.getElementById("selectSobre_1_").style.display = "block";
    }

    function mostrarExcluir() {
	document.getElementById("selectExcluir").style.display = "block";
    }

    function mostrarCadastrar() {
	document.getElementById("selectCadastrar").style.display = "block";
    }

    function mostrarVendedor(){
        document.getElementById("SelectVendedor").style.display = "block";
    }

    function clicarContatos() {
        window.parent.document.getElementById("Contato").className = "animated fadeIn";
		window.parent.document.getElementById("Contato").style.display = "block";
        window.parent.document.getElementById("telaEscura").style.display = "block";
    }

    function clicarSobre() {
        window.parent.document.getElementById("Sobre").className = "animated fadeIn";
		window.parent.document.getElementById("Sobre").style.display = "block";
        window.parent.document.getElementById("telaEscura").style.display = "block";
        window.parent.document.getElementById("Contato").style.display = "none";
    }

    function clicarVendedor(){
        window.parent.document.getElementById("Vendedores").className = "animated fadeIn";
	window.parent.document.getElementById("Vendedores").style.display = "block";
        window.parent.document.getElementById("telaEscura").style.display = "block";

    }

    function clicarProduto() {
        window.parent.document.getElementById("Produtos").className = "animated fadeIn";
		window.parent.document.getElementById("Produtos").style.display = "block";
        window.parent.document.getElementById("telaEscura").style.display = "block";
        window.parent.document.getElementById('frameProdutos').contentWindow.location.reload();
    }

    function clicarCadastrar() {
        window.parent.document.getElementById("Cadastrar").className = "animated fadeIn";
	window.parent.document.getElementById("Cadastrar").style.display = "block";
        window.parent.document.getElementById("telaEscura").style.display = "block";

    }

    function clicarAlterar() {
        window.parent.document.getElementById("Alterar").className = "animated fadeIn";
		window.parent.document.getElementById("Alterar").style.display = "block";
        window.parent.document.getElementById("telaEscura").style.display = "block";
        window.parent.document.getElementById('frameAlterar').contentWindow.location.reload();
    }

    function clicarExcluir() {
        window.parent.document.getElementById("Excluir").className = "animated fadeIn";
		window.parent.document.getElementById("Excluir").style.display = "block";
        window.parent.document.getElementById("telaEscura").style.display = "block";
		window.parent.document.getElementById("frameExcluir").contentWindow.location.reload();
    }



	function mostrarSubBtn(){
		if(document.getElementById("Botoes_1_").style.display == "block"){
			document.getElementById("Botoes_1_").style.display = "none";
		}else{
			document.getElementById("Botoes_1_").style.display = "block";
		}		
	}

	function ocultarSelectBtn(){
		document.getElementById("BtnCadastra").style.opacity = 0.5;
		document.getElementById("BtnAltera").style.opacity = 0.5;
		document.getElementById("BtnExclui").style.opacity = 0.5;
	}

	function mostrarBtnExcluir(){
		document.getElementById("BtnExclui").style.opacity = 1;
	}

	function mostrarBtnCadastrar(){
		document.getElementById("BtnCadastra").style.opacity = 1;
	}

	function mostrarBtnAlterar(){
		document.getElementById("BtnAltera").style.opacity = 1;
	}
